import React from 'react'
import { SafeAreaView, Text } from 'react-native';
import Todo from './components/Todo';

export default function TodoApp() {
  return (
    <SafeAreaView>
        <Text>Today</Text>
        <Todo/>
    </SafeAreaView>
  )
}
